import React from 'react';
import * as ReactBootStrap from 'react-bootstrap';

const About = () => {
    return (
        <div id="About">
            <ReactBootStrap.Jumbotron style={{
                backgroundColor: '#fff',
            }} fluid>
                <ReactBootStrap.Container style={{
                    height: 'fit-content',
                }}>

                </ReactBootStrap.Container>
            </ReactBootStrap.Jumbotron>
        </div>
    )
}
export default About
